import React, { useState, useEffect } from 'react'

export default function App(){

  const [data, SetData] = useState('colombia')

  const colom = "colombia";
  const url = `http://localhost:5000/members/${colom}`;

  console.log(url)
  useEffect(()=> {

    fetch(url).then(

      res=> res.json()
    ).then(
        data=> {
          SetData(data)
          console.log(data)
          console.log(Object.values(data));

        }
    )
  }, [])



  return (
    <div>
    {data.map(texto => (
      <div className="textContainer">
        <div className="text">{texto.capital}</div>
      </div>
    ))}
  </div>
  );
};
